import "./AgentList.css";
import React, { useEffect, useState } from "react";
import { faTrash, faPencilAlt } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { useDispatch, useSelector } from "react-redux";
import { process } from "@progress/kendo-data-query";
import { Grid, GridColumn } from "@progress/kendo-react-grid";
import { getAllAgents } from "../../reducers/AgentReducer";
function AgentList() {
  const dispatch = useDispatch();
  const { agentList } = useSelector((state) => state.agent);
  useEffect(() => {
    dispatch(getAllAgents());
  }, []);
  return (
    <div className="p-3">
      <h4>Agent List</h4>
      <Grid
        data={agentList}
        style={{
          height: "500px",
          width: "100%",
        }}
        reorderable={true}
        resizable={true}
      >
        <GridColumn field="userId" title="ID" />
        <GridColumn field="name" title="Name" />
        <GridColumn field="email" title="Email" />
        <GridColumn field="dob" title="DOB" />
        <GridColumn field="crmId" title="CRM ID" />
        <GridColumn field="teleCallingId" title="Tele calling Id" />
        <GridColumn field="address" title="Address" />
        <GridColumn field="licenseUrnNo" title="License URN" />
        <GridColumn field="licenseExpiryDate" title="License Expiry Date" />
        <GridColumn field="licenseIssueDate" title="License Issue Date" />
        <GridColumn
          title="Actions"
          cell={(props) => (
            <FontAwesomeIcon className="cursor-pointer" icon={faPencilAlt} />
          )}
        />
      </Grid>
    </div>
  );
}

export default AgentList;
